import {
    FirstView,
    BigText
} from '../Fintech/componenets/fintech1Style'

export default function Fintech1(){
    return( 
    <SafeAreaView>
     <ScrollView style={styles.container}>
         <FirstView>
         <Icon size={20} color="#CDA360" name="back" style={styles.pad}/>
         <View style={styles.pad}>
         <BigText>Procurement</BigText>
         </View>
         <Icon1 sixe={30} color="#CDA360" name="clipboard" style={styles.pad}/>
         </FirstView>
         
     </ScrollView>
    </SafeAreaView>
     
    )
   
}

const styles = StyleSheet.create({
box: {
    flex:1,
    backgroundColor: "#000"
},
container: {
    backgroundColor: "#000",
    paddingTop: "25px",
    flex: 1,

},
pad: {
    padding: 20,
}
